import React from 'react'; // code written entirely by GPT
import { Grid, Paper, Typography, Box } from '@mui/material';

const ProjectCard = ({ imageSrc, title, children }) => {
  return (
    <Grid item xs={12} sm={6} md={4}>
      <Paper sx={{ p: 2 }}>
        <Grid container spacing={2}>
          <Grid item xs={12} md={6}>
            <img src={imageSrc} alt={title} style={{ width: '100%' }} />
          </Grid>
          <Grid item xs={12} md={6}>
            <Typography variant="h6" sx={{fontFamily:"Helvetica"}} >{title}</Typography>
            <Typography variant="body2" sx={{fontFamily:"Helvetica"}} >{children}</Typography>
          </Grid>
        </Grid>
      </Paper>
    </Grid>
  );
};

export default ProjectCard;
